	ReEnableDevice(context.Context, *voltha.Device) (*empty.Empty, error)
	RebootDevice(context.Context, *voltha.Device) (*empty.Empty, error)
	SelfTestDevice(context.Context, *voltha.Device) (*empty.Empty, error)
