	GetSingleValue(context.Context, *extension.SingleGetValueRequest) (*extension.SingleGetValueResponse, error)
	SetSingleValue(context.Context, *extension.SingleSetValueRequest) (*extension.SingleSetValueResponse, error)
	DisableChildDevice(context.Context, *voltha.Device) (*empty.Empty, error)
	EnableChildDevice(context.Context, *voltha.Device) (*empty.Empty, error)
	DisableChildSerialNumber(context.Context, *voltha.OnuSerialNumberOfOLTPon) (*empty.Empty, error)
	EnableChildSerialNumber(context.Context, *voltha.OnuSerialNumberOfOLTPon) (*empty.Empty, error)
